Eesti Otsemüügi Assotsiatsioon (EDSA) on mittetulundusühing, kuhu kuuluvad juhtivad ettevõted, mis toodavad ja levitavad otse tarbijatele müüdavaid tooteid ja teenuseid.

Meie eesmärgiks on:
- soodustada otsemüügi kasvu ning tugevdada arusaama, et otsemüük on oluline toodete ja teenuste levitamise võimalus Eesti tarbijatele;
- parandada otsemüügi mainet ning toetada otsemüüki kui seaduslikku individuaalse äritegevuse viisi ja lisasissetuleku võimalust;
- edendada ausat konkurentsi ja tarbija õig

PyroShow OÜ on professionaalsete ja kogenud pürotehnikute meeskond Eestist ning TulePood.ee ilutulestikud on parim ilutulestikupood , mis on avatud aastaringselt!

Meie töötame üle kogu Eesti ja tegevusvaldkonnad on mitmekülgsed: pulmad, firmapeod, sünnipäevad, suured ja väiksemad pühad, kontserdid, tulefestival ja linna üritused.

